var _story_ = {
    "1220": [
        {
            "_id": 1,
            "Story": "The Xianzhou Yaoqing's Merlin's Claw and one of the Seven Arbiter-Generals. Unconventional and straightforward, she exudes effortless charm.<br>She is skilled in all forms of martial arts and has honed herself into a supreme weapon. She is widely adored by Xianzhou soldiers and civilians alike as \"The Vanquishing General.\"<br>However, she bears the burden of the Moon Rage affliction. If she were to hunt down all the abominations in her limited lifetime — then the only enemy Feixiao has would be herself."
        },
        {
            "_id": 2,
            "Story": "A hint of metallic smell of blood and unrest hangs in the air.<br><br><i>\"Neergul...\"</i><br>She gently pats the trembling partner by her side, \"I smell... A chance for freedom. Tonight is the night.\"<br><i>\"Saran, the bodies of the three foxian slaves that tried to escape are still hanging on the gates...\"<br>\"No, tonight is different.\"</i><br>She raises her head and stares off into the distance as a giant streaming light slowly traces across the sky. <br><i>\"Tonight, there will be shooting stars.\"</i><br>She takes her companion's hand in hers,<i>\"It's okay. Just keep looking forward and don't look back.\"</i><br><br>Under the cold and brilliant light of the shooting stars, two delicate silhouettes race across the endless plains. The bloodstained air whips at their faces as the chilling howls of the wolves endlessly stir up the fear buried deep in their blood.<br>However, she never doubted that they would escape the wolf pack's pursuit.<br>As long as they wish on the \"shooting star,\" it would shine down on them. If they just chase that light in the sky, they would reach where it lies in the distance. As they continue to run with all their strength, it seems as if the light is growing ever nearer.<br>That is no \"shooting star.\" It's a woman who could fly. She calls herself the General of the Xianzhou Yaoqing. Her name is Yueyu.<br><br>In the distance, a military force that she had never seen before comes rushing from behind her, as countless arrows flow past her head to rain down on the pursuing borisin.<br><i>\"Look, Neergul! The shooting star granted our wish!\"</i><br>She shouts joyously, never once looking back. She does not see this \"shooting star\" falling to the ground and reduces everything to silence."
        },
        {
            "_id": 3,
            "Story": "In the Yaoqing military barracks, she puts on the armor of the Cloud Knights and picks up a weapon.<br>A new language, a new way of life, a new name and new battle tactics. She studies in intense agony, yet learns everything quickly. She would follow Yueyu into battle and bear the general's flag. During their countless conquests, she becomes an elite warrior.<br>The battle cry would still occasionally echo in her ears from time to time, but she initially believed that was just fear.<br><br>Until one day she closes her eyes as a warm scarlet flows across her vision. She thinks that she sees a sanguineous moon gently calling out to her, stirring up the blood in her veins.<br>Her skin begins to split inch after inch as a wild power pours into her body like roaring waves — She realizes that, with just a gentle tiptoe, she could move in unrivaled speed like a flash of light.<br>She traverses the battlefield, bathed in blood, delivering death to her enemies before they even realize what is happening. A fissure in the enemy's ranks begins to grow wider and wider.<br>As the long battle continues under a rain of blood, her movements seem to grow only faster. No one could hope to match her speed.<br><br>Fear... That is what she sees in the eyes of her enemies. All that she feels in her body is intimidation and rage.<br>When she regains her senses, she looks back on the path she has covered to see only borisin corpses behind her, piled higher and higher.<br>The Yaoqing soldiers are looking at her from a distance, their eyes filled with surprise, admiration, and also fear.<br>She collapses to the ground.<br><br>When she wakes up, Yueyu sits alone by her bedside as muffled voices reach her ears from outside the tent.<br><i>\"Didn't you see that she had no tail? That's a bit too...\"<br>\"Is it natural? That's an awful shame.\"<br>\"She used to be a borisin war slave after all... Explains her raw ferocity.\"<br>\"You couldn't tell she was in 'Moon Rage'? I was about to wet myself at the sight. Thought she couldn't recognize anyone...\"<br>\"But if it wasn't for her, we might not have been able to win so easily this time.\"</i><br>She realizes that these voices will likely follow her for the rest of her life."
        },
        {
            "_id": 4,
            "Story": "She had once returned to her old home of Koolur. However, what greeted her there was neither the roar of wolves nor the call of foxes, but simply a bottomless ravine. After the light waves had engulfed everything in flames, not even bones remained.<br>However, she still follows the shooting star. Everyone here follows it — It is the light of the Reignbow, their spiritual support in times of great danger.<br>That's precisely why she could not believe her eyes when the Denizens of Abundance attacked again — the shooting star is now descending on them.<br>Even if there are countless Abominations of Abundance gathering there, there are also countless Yaoqing soldiers boldly fighting to the death.<br><br>Yet the sound of the shooting star splitting the skies grows ever closer, like the footsteps of death itself. Her whole body feels cold, like she had suddenly plummeted to the icy depths of hell.<br>Under the light of the Reignbow, even the general she has always regarded as invincible is ground to dust. She desperately runs onto the battlefield, trying to bring back any survivors, until she loses consciousness in the residual light.<br>She looses a roar of rage into the air, but no one can hear her.<br>Everything is reduced to silence.<br><br>From that day, she would have constant nightmares. People in her dreams would reach out their hands to her but, before she could arrive to help them, they are devoured by the light.<br><i>\"More... I have to save more...\"</i><br>She would awake from these dreams with her face covered in tears. But she knows that all her promises could only ever be fulfilled on the battlefield.<br><br>She puts on her armor and walks to the very front of the formation. She allows the madness to seep into her blood and uses her bare hands to tear open a crimson path for her forces to advance.<br>She descends on the enemy like a meteor, and mountain-like beasts crumble to dust under the force of her attacks.<br>She single-handedly pushes the enemy armies to retreat before her soldiers' eyes.<br><i>\"The Merlin's Claw! The Merlin's Claw!\"</i><br>The weak call she heard before has completely transformed into a battle cry, as a great and primitive will wake with her infection.<br><br>She stands still among the rain of blood and roars out in a berserk rage<br><i>\"I promise you all.<br>One day, I will be faster than the Reignbow's Lux Arrow.<br>One day, we shall no longer have to witness the falling of 'shooting stars.'\"</i><br><br>On that day, in that rain, she is reborn and recast in blood and fire."
        },
        {
            "_id": 5,
            "Story": "Today is a rare day of rest.<br>By the time that dawn started to break, she had already set off from her home, but her destination is a little different today.<br>Today is the day of her periodical health inspection.<br><br><i>\"Do you get dizzy?\"<br>\"No.\"<br>\"Spells of fatigue?\"<br>\"No.\"<br>\"Any irregularities with your heart?\"<br>\"No.\"</i><br>The foxian doctor furrows his brows.<br><i>\"General, with all due respect, if everything were as normal, these reports of yours would be sheer nonsense. You and I both know that the consequences of Moon Rage are becoming more frequent and pronounced. All I can do is try my best to slow it down.\"<br>\"So?\"<br>\"But it is all just a matter of time. I fear that, in the future, you will completely lose yourself, never to...\"</i><br>She smiles.<br><i>\"You are responsible for 'curing' me, and I am responsible for 'curing' war. We promised that we would both give our all to these roles.\"</i><br><br>After receiving her medication, she deliberately takes a long route home across a quiet and secluded path. On the other side of the wall, she can hear the bustling and excited sounds of people in a packed market street. The calls of vendors and the laughter of children rise and fall.<br>\"What a wonderful time this is.\" She murmurs to herself.<br><br>Suddenly, a Yellowbell Resonance System notification begins to ring in her ears:<br><i>\"We have secured a resounding victory against Toste-VIII abominations.\"<br>\"We have secured a resounding victory against the Sakin Chadu abominations thanks to the IPC's assistance after initial setbacks.\"<br>\"We have secured a resounding victory in the battle of Gordo.\"<br>\"...\"</i><br><br>Before her life ends, she will hunt down every one of her nemeses.<br>Until the day that Moon Rage turns her into a truly feral beast that cannot tell friends from foe.<br>Until the day... when the arrow of The Hunt will pierce her own heart."
        }
    ]
}

